import React, { useState } from "react";
import { useLocation, useHistory } from "react-router-dom";
import { createTheme, ThemeProvider } from "@mui/material/styles";
import Box from "@mui/material/Box";
import Typography from "@mui/material/Typography";
import Container from "@mui/material/Container";
import CssBaseline from "@mui/material/CssBaseline";
import Avatar from "@mui/material/Avatar";
import Button from "@mui/material/Button";
import Link from "@mui/material/Link";
import Checkbox from "@mui/material/Checkbox";
import FormControlLabel from "@mui/material/FormControlLabel";
import TextField from "@mui/material/TextField";
import FormControl from "@mui/material/FormControl";
import { FormGroup } from "@mui/material";
import PantryApi from "../pantryApi";
import NewOrderItemForm from "./NewOrderItemForm";

// import NewOrderItemForm from "./NewOrderItemForm";

function Copyright(props) {
  return (
    <Typography
      variant="body2"
      color="text.secondary"
      align="center"
      {...props}
    >
      {"Copyright Â© "}
      <Link color="inherit" href="https://mui.com/">
        Pantry
      </Link>{" "}
      {new Date().getFullYear()}
      {"."}
    </Typography>
  );
}

function NewOrderForm(props) {
  const history = useHistory();
  const location = useLocation();
  const food = props.food;
  const order = location.state.params;

  // initial check state for each food item set to false
  const initialCheckState = {
    blackBeans: false,
    cereal: false,
    chickPeas: false,
    chicken: false,
    chickenFort: false,
    chili: false,
    cookies: false,
    corn: false,
    fruit: false,
    greenBeans: false,
    hash: false,
    Jello: false,
    jelly: false,
    macCheese: false,
    mayo: false,
    milk: false,
    pasta: false,
    pastaSauce: false,
    peanutButter: false,
    peas: false,
    porkBeans: false,
    redBeans: false,
    saltines: false,
    soup: false,
    stew: false,
    tuna: false,
    whiteRice: false,
  };

  let initialState = {};

  const [checked, setChecked] = useState(initialCheckState);
  const [formErrors, setFormErrors] = useState([]);
  const [formData, setFormData] = useState(initialState);

  const {
    blackBeans,
    cereal,
    chickPeas,
    chicken,
    milk,
    pasta,
    pastaSauce,
    soup,
    stew,
    hash,
    chili,
    porkBeans,
    redBeans,
    greenBeans,
    corn,
    peas,
    fruit,
    macCheese,
    whiteRice,
    peanutButter,
    jelly,
    tuna,
    mayo,
    cookies,
    saltines,
    Jello,
  } = checked;

  const pantryTheme = createTheme();

  const handleCheckChange = (event) => {
    setChecked({ ...checked, [event.target.name]: event.target.checked });
  };

  const handleChange = (evt) => {
    const { name, value } = evt.target;
    setFormData((data) => ({
      ...data,
      [name]: value,
    }));
  };

  async function handleSubmit(event) {
    event.preventDefault();

    // within food array find food item where key in object = (foodId)
    //   for (let key in formData) {
    //     if (formData[key]) {
    //       const quantity = formData[key];
    //       const item = food.find((f) => f.foodId === parseInt(key));

    //       if (quantity > item.inventory) {
    //         // ERROR MESSAGE HERE
    //       } else {
    //         const foodItem = await PantryApi.addOrderItems(order.orderId, key, {
    //           quantity,
    //         });

    //         if (foodItem) {
    //           history.push("/clients");
    //         }
    //       }
    //     }
    //   }
    // }
  }
  return (
    <ThemeProvider theme={pantryTheme}>
      <Container component="main" maxWidth="lg">
        <CssBaseline />
        <Box
          sx={{
            marginTop: 8,
            display: "flex",
            flexDirection: "column",
            alignItems: "center",
          }}
        >
          <Avatar sx={{ m: 1, bgcolor: "secondary.main" }}>
            <span className="material-symbols-outlined">nutrition</span>
          </Avatar>
          <Typography component="h1" variant="h5" sx={{ textAlign: "center" }}>
            Pantry Menu
          </Typography>
          <Typography component="h2" sx={{ textAlign: "center" }}>
            {/* {date} */}
          </Typography>
          <Typography
            component="h3"
            sx={{ textAlign: "center", fontSize: ".9rem", mb: 3 }}
          >
            Clients can choose up to 12 items. Limit of 2 per item, except where
            noted.
          </Typography>
          <Box
            component="form"
            onSubmit={handleSubmit}
            noValidate
            sx={{ mt: 1 }}
          >
            {food.map((f) => (
              <NewOrderItemForm
                key={f.foodId}
                orderId={order.orderId}
                foodId={f.foodId}
                name={f.name}
                inventory={f.inventory}
              />
            ))}

            <FormGroup aria-label="position" row>
              <Box sx={{ display: "flex", flexDirection: "row" }}>
                <FormControlLabel
                  control={
                    <Checkbox
                      checked={chicken}
                      id="chicken"
                      name="chicken"
                      onChange={handleCheckChange}
                    />
                  }
                  label="Chicken"
                />
                {checked.chicken ? (
                  <TextField
                    margin="normal"
                    fullWidth
                    id="chicken"
                    name="6"
                    label="# Chicken"
                    onChange={handleChange}
                    autoFocus
                  />
                ) : (
                  ""
                )}
              </Box>
            </FormGroup>

            <FormGroup aria-label="position" row>
              <Box sx={{ display: "flex", flexDirection: "row" }}>
                <FormControlLabel
                  control={
                    <Checkbox
                      checked={cereal}
                      id="cereal"
                      name="cereal"
                      onChange={handleCheckChange}
                    />
                  }
                  label="Cereal"
                />

                {checked.cereal ? (
                  <TextField
                    margin="normal"
                    fullWidth
                    id="cereal"
                    name="2"
                    label="# Cereal"
                    onChange={handleChange}
                    value={formData.cereal}
                  />
                ) : (
                  ""
                )}
              </Box>
            </FormGroup>

            <FormGroup aria-label="position" row>
              <Box sx={{ display: "flex", flexDirection: "row" }}>
                <FormControlLabel
                  control={
                    <Checkbox
                      checked={milk}
                      id="milk"
                      name="milk"
                      onChange={handleCheckChange}
                    />
                  }
                  label="Milk"
                />

                {checked.milk ? (
                  <TextField
                    margin="normal"
                    fullWidth
                    id="milk"
                    name="3"
                    label="# Milk"
                    onChange={handleChange}
                    value={formData.milk}
                  />
                ) : (
                  ""
                )}
              </Box>
            </FormGroup>

            <FormGroup aria-label="position" row>
              <Box sx={{ display: "flex", flexDirection: "row" }}>
                <FormControlLabel
                  control={
                    <Checkbox
                      checked={pastaSauce}
                      id="pastaSauce"
                      name="pastaSauce"
                      onChange={handleCheckChange}
                    />
                  }
                  label="Pasta Sauce"
                />
                {checked.pastaSauce ? (
                  <TextField
                    margin="normal"
                    fullWidth
                    id="pastaSauce"
                    name="4"
                    label="# Pasta Sauce"
                    onChange={handleChange}
                    value={formData.pastaSauce}
                  />
                ) : (
                  ""
                )}
              </Box>
            </FormGroup>

            <FormGroup aria-label="position" row>
              <Box sx={{ display: "flex", flexDirection: "row" }}>
                <FormControlLabel
                  control={
                    <Checkbox
                      checked={pasta}
                      id="pasta"
                      name="pasta"
                      onChange={handleCheckChange}
                    />
                  }
                  label="Pasta"
                />
                {checked.pasta ? (
                  <TextField
                    margin="normal"
                    fullWidth
                    id="pasta"
                    name="5"
                    label="# Pasta"
                    onChange={handleChange}
                    value={formData.pasta}
                  />
                ) : (
                  ""
                )}
              </Box>
            </FormGroup>

            <FormGroup aria-label="position" row>
              <Box sx={{ display: "flex", flexDirection: "row" }}>
                <FormControlLabel
                  control={
                    <Checkbox
                      checked={soup}
                      id="soup"
                      name="soup"
                      onChange={handleCheckChange}
                    />
                  }
                  label="Soup"
                />
                {checked.soup ? (
                  <TextField
                    margin="normal"
                    fullWidth
                    id="soup"
                    name="7"
                    label="# Soup"
                    onChange={handleChange}
                    value={formData.soup}
                  />
                ) : (
                  ""
                )}
              </Box>
            </FormGroup>

            <FormGroup aria-label="position" row>
              <Box sx={{ display: "flex", flexDirection: "row" }}>
                <FormControlLabel
                  control={
                    <Checkbox
                      checked={stew}
                      id="stew"
                      name="stew"
                      onChange={handleCheckChange}
                    />
                  }
                  label="Stew"
                />
                {checked.stew ? (
                  <TextField
                    margin="normal"
                    fullWidth
                    id="stew"
                    name="8"
                    label="# Stew"
                    onChange={handleChange}
                    value={formData.stew}
                  />
                ) : (
                  ""
                )}
              </Box>
            </FormGroup>

            <FormGroup aria-label="position" row>
              <Box sx={{ display: "flex", flexDirection: "row" }}>
                <FormControlLabel
                  control={
                    <Checkbox
                      checked={hash}
                      id="hash"
                      name="hash"
                      onChange={handleCheckChange}
                    />
                  }
                  label="Hash"
                />
                {checked.hash ? (
                  <TextField
                    margin="normal"
                    fullWidth
                    id="hash"
                    name="9"
                    label="# Hash"
                    onChange={handleChange}
                    value={formData.hash}
                  />
                ) : (
                  ""
                )}
              </Box>
            </FormGroup>

            <FormGroup aria-label="position" row>
              <Box sx={{ display: "flex", flexDirection: "row" }}>
                <FormControlLabel
                  control={
                    <Checkbox
                      checked={chili}
                      id="chili"
                      name="chili"
                      onChange={handleCheckChange}
                    />
                  }
                  label="Chili"
                />
                {checked.chili ? (
                  <TextField
                    margin="normal"
                    fullWidth
                    id="chili"
                    name="10"
                    label="# Chili"
                    onChange={handleChange}
                    value={formData.chili}
                  />
                ) : (
                  ""
                )}
              </Box>
            </FormGroup>

            <FormGroup aria-label="position" row>
              <Box sx={{ display: "flex", flexDirection: "row" }}>
                <FormControlLabel
                  control={
                    <Checkbox
                      checked={porkBeans}
                      id="porkBeans"
                      name="porkBeans"
                      onChange={handleCheckChange}
                    />
                  }
                  label="Pork & Beans"
                />
                {checked.porkBeans ? (
                  <TextField
                    margin="normal"
                    fullWidth
                    id="porkBeans"
                    name="11"
                    label="# Pork & Beans"
                    onChange={handleChange}
                    value={formData.porkBeans}
                  />
                ) : (
                  ""
                )}
              </Box>
            </FormGroup>

            <FormGroup aria-label="position" row>
              <Box sx={{ display: "flex", flexDirection: "row" }}>
                <FormControlLabel
                  control={
                    <Checkbox
                      checked={chickPeas}
                      id="chickPeas"
                      name="chickPeas"
                      onChange={handleCheckChange}
                    />
                  }
                  label="Chick Peas"
                />
                {checked.chickPeas ? (
                  <TextField
                    margin="normal"
                    fullWidth
                    id="chickPeas"
                    name="12"
                    label="#Chick Peas"
                    onChange={handleChange}
                    value={formData.chickPeas}
                  />
                ) : (
                  ""
                )}
              </Box>
            </FormGroup>

            <FormGroup aria-label="position" row>
              <Box sx={{ display: "flex", flexDirection: "row" }}>
                <FormControlLabel
                  control={
                    <Checkbox
                      checked={redBeans}
                      id="redBeans"
                      name="redBeans"
                      onChange={handleCheckChange}
                    />
                  }
                  label="Red Beans"
                />
                {checked.redBeans ? (
                  <TextField
                    margin="normal"
                    fullWidth
                    id="redBeans"
                    name="13"
                    label="# Red Beans"
                    onChange={handleChange}
                    value={formData.redBeans}
                  />
                ) : (
                  ""
                )}
              </Box>
            </FormGroup>

            <FormGroup aria-label="position" row>
              <Box sx={{ display: "flex", flexDirection: "row" }}>
                <FormControlLabel
                  control={
                    <Checkbox
                      checked={blackBeans}
                      id="blackBeans"
                      name="blackBeans"
                      onChange={handleCheckChange}
                    />
                  }
                  label="Black Beans"
                />
                {checked.redBeans ? (
                  <TextField
                    margin="normal"
                    fullWidth
                    id="blackBeans"
                    name="14"
                    label="# Black Beans"
                    onChange={handleChange}
                    value={formData.blackBeans}
                  />
                ) : (
                  ""
                )}
              </Box>
            </FormGroup>

            <FormGroup aria-label="position" row>
              <Box sx={{ display: "flex", flexDirection: "row" }}>
                <FormControlLabel
                  control={
                    <Checkbox
                      checked={greenBeans}
                      id="greenBeans"
                      name="greenBeans"
                      onChange={handleCheckChange}
                    />
                  }
                  label="Green Beans"
                />
                {checked.greenBeans ? (
                  <TextField
                    margin="normal"
                    fullWidth
                    id="greenBeans"
                    name="15"
                    label="# Green Beans"
                    onChange={handleChange}
                    value={formData.greenBeans}
                  />
                ) : (
                  ""
                )}
              </Box>
            </FormGroup>

            <FormGroup aria-label="position" row>
              <Box sx={{ display: "flex", flexDirection: "row" }}>
                <FormControlLabel
                  control={
                    <Checkbox
                      checked={corn}
                      id="corn"
                      name="corn"
                      onChange={handleCheckChange}
                    />
                  }
                  label="Corn"
                />
                {checked.corn ? (
                  <TextField
                    margin="normal"
                    fullWidth
                    id="corn"
                    name="16"
                    label="# Corn"
                    onChange={handleChange}
                    value={formData.corn}
                  />
                ) : (
                  ""
                )}
              </Box>
            </FormGroup>

            <FormGroup aria-label="position" row>
              <Box sx={{ display: "flex", flexDirection: "row" }}>
                <FormControlLabel
                  control={
                    <Checkbox
                      checked={peas}
                      id="peas"
                      name="peas"
                      onChange={handleCheckChange}
                    />
                  }
                  label="Peas"
                />
                {checked.peas ? (
                  <TextField
                    margin="normal"
                    fullWidth
                    id="peas"
                    name="17"
                    label="# Peas"
                    onChange={handleChange}
                    value={formData.peas}
                  />
                ) : (
                  ""
                )}
              </Box>
